from functools import reduce

def find_max_product_of_five(test_cases):
    results = []
    for case in test_cases:
        n = len(case)
        a = sorted(case)
        if n != 5:
            ans = reduce(lambda x, y: x * y, a)
            results.append(ans)
            continue
        nl = []
        pl = []
        for i in range(4):
            if a[i] < 0:
                nl.append(a[i])
            else:
                break
        for i in range(n - 1, n - 6, -1):
            if a[i] > 0:
                pl.append(a[i])
            else:
                break
        if len(pl) == 0:
            ans = reduce(lambda x, y: x * y, a[n - 5:n])
        elif len(nl) < 2:
            ans = reduce(lambda x, y: x * y, a[n - 5:n])
        elif len(pl) >= 3 and len(nl) >= 2 or (len(pl) >= 1 and len(nl) >= 4) or len(pl) == 5:
            ans1 = ans2 = ans3 = 1
            if len(pl) == 5:
                ans1 = reduce(lambda x, y: x * y, pl)
            if len(pl) >= 3:
                pp = 1
                for i in range(3):
                    pp = pp * pl[i]
                np = nl[0] * nl[1]
                ans2 = pp * np
            if len(nl) == 4:
                ans3 = reduce(lambda x, y: x * y, nl)
                ans3 = ans3 * pl[0]
            ans = max(ans1, ans2, ans3)
        else:
            ans = 0
        results.append(ans)
    return results

